import React from 'react';
import  './card.css'
import Card from 'react-bootstrap/Card'
import Button from 'react-bootstrap/Button'
import {
  BrowserRouter as Router,
  Link,
  Redirect,
  useParams,
  useRouteMatch

} from "react-router-dom";

export default function Carts({data}) {
  let { url } = useRouteMatch();
  let { id } = useParams();


  let fullName = data["full-name"];
  let birthPlace=data["place-of-birth"]

  return (

  <Router>

    <Link to={`${url}/${id}`}  >
            <Card style={{ width: '18rem',margin:"10px",display:"inline-block"}}>

                    {data.url ?<Card.Img variant="top"  src={data.url} />:<Card.Img variant="top"  src="https://www.superherodb.com/pictures2/portraits/10/100/1508.jpg" />}
                    <Card.Body>
                      <Card.Title>{data.name}</Card.Title>
                      <Card.Text>
                        {fullName}
                      <br></br>
                        {birthPlace}
                        <br></br>
                      {data.publisher}

                    </Card.Text>
                      <Button variant="primary" >More Details</Button>
                    </Card.Body>
                  </Card>
        </Link>


      </Router>
    )






}
